        watch: {
            'cardDetails.cardNumber': function (n, o) {
                var th = this;
                th.bankBinNumber = {};
                if (n && n.length >= 6) {
                    var number = n.replaceAll(' ', '');
                    var bankBinNumber = th.bankBinNumbers.filter(function (f) {
                        var b = f.bin;
                        return number.startsWith(b, 0);
                    })[0];
                    th.bankBinNumber = bankBinNumber;
                }
            }
        },
        computed: {
            getCardType() {
                var cardType = {
                    base64: 'data:image/png;base64,',
                    type: 'visa',
                };
                var th = this;
                var number = th.cardDetails.cardNumber;
                re = new RegExp("^(34|37)");
                if (number.match(re) != null) {
                    cardType.base64 = 'data:image/png;base64,';
                    cardType.type = 'amex';
                }
                re = new RegExp("^5[1-5]");
                if (number.match(re) != null) {
                    cardType.base64 = 'data:image/png;base64,';
                    cardType.type = 'mastercard';
                }
                re = new RegExp("^6011");
                if (number.match(re) != null) {
                    cardType.base64 = 'data:image/png;base64,';
                    cardType.type = 'discover';
                }

                re = new RegExp('^9792')
                if (number.match(re) != null) {
                    cardType.base64 = 'data:image/png;base64,';
                    cardType.type = 'troy';
                }
                return cardType;
            },
            generateCardNumberMask() {
                return this.getCardType.type === "amex" ? this.mask.amexCardMask : this.mask.otherCardMask;
            },
            minCardMonth() {
                if (this.cardDetails.cardYear === this.cardDetails.minCardYear) return new Date().getMonth() + 1;
                return 1;
            },
            get_bank_logo() {
                var th = this;
                var bank = th.bankBinNumber;
                if (bank == null) {
                    return 'data:image/png;base64,';
                }
                switch (bank.banka_kodu) {
                    case 10:
                        // TC ZİRAAT BANKASI
                        return 'data:image/png;base64,';
                    case 12:
                        // TÜRKİYE HALK BANKASI
                        return 'data:image/png;base64,';
                    case 15:
                        // TÜRKİYE VAKIFLAR BANKASI
                        return 'data:image/png;base64,';
                    case 32:
                        // TÜRKİYE EKONOMİ BANKASI
                        return 'data:image/png;base64,';
                    case 46:
                        // AK BANK
                        return 'data:image/png;base64,';
                    case 59:
                        // ŞEKER BANK
                        return 'data:image/svg+xml;base64,';
                    case 62:
                        // TÜRKİYE GARANTİ BANAKSI
                        return 'data:image/svg+xml;base64,'
                    case 64:
                        // TÜRKİYE İŞ BANKASI
                        return 'data:image/png;base64,';
                    case 67:
                        // YAPI VE KREDİ BANKASI A.Ş
                        return 'data:image/jpeg;base64,';
                    case 92:
                        // CITY BANK A.Ş
                        return 'data:image/png;base64,';
                    case 96:
                        // TURKISH BANK
                        return 'data:image/png;base64,';
                    case 99:
                        // İNG BANK
                        return 'data:image/png;base64,';
                    case 103:
                        // MILLENNIUM BANK A.Ş
                        return 'data:image/png;base64,';
                    case 108:
                        // TURK LAND
                        return 'data:image/jpeg;base64,';
                    case 111:
                        // Finans Bank
                        return 'data:image/png;base64,';
                    case 123:
                        // HSBC
                        return 'data:image/svg+xml;base64,';
                    case 125:
                        // EURO BANK
                        return 'data:image/svg+xml;base64,';
                    case 134:
                        // DENİZ BANK
                        return 'data:image/svg+xml;base64,';
                    case 135:
                        // Anadolu Bank
                        return 'data:image/svg+xml;base64,';
                    case 203:
                        // Al Baraka
                        return 'data:image/svg+xml;base64,';
                    case 205:
                        // KUVETY TÜRK
                        return 'data:image/png;base64,';
                    case 206:
                        // Türkiye Finans Katılım Bankası
                        return 'data:image/png;base64,';

                    default:
                        return 'data:image/png;base64,';
                }

            },
        },
        methods: {
            flipCard(status) {
                this.isFlip = status;
            },
            focusInput: function (e) {
                this.isInputFocused = true;
                if (e) {
                    let targetRef = e.target.dataset.ref;
                    let target = this.$refs[targetRef];
                    this.focusElementStyle = {
                        width: `${target.offsetWidth}px`,
                        height: `${target.offsetHeight}px`,
                        transform: `translateX(${target.offsetLeft}px) translateY(${target.offsetTop}px)`
                    };
                }

            },
            blurInput: function () {
                let vm = this;
                setTimeout(() => {
                    if (!vm.isInputFocused) {
                        vm.focusElementStyle = null;
                    }
                }, 300);
                vm.isInputFocused = false;
            },
            cmd_payment: function () {
                var th = this;
                var arr = JSON.parse(localStorage.getItem('payment-items'));
                var obj = JSON.parse(localStorage.getItem('payment-item'))
                var newArray = arr.filter(function (f) {
                    return f.InvoiceNumber != obj.InvoiceNumber
                });
                if (th.cardDetails.cardNumber == null
                    || th.cardDetails.cardNumber == undefined
                    || th.cardDetails.cardNumber.length <= 0
                    || th.cardDetails.cardName == null
                    || th.cardDetails.cardName == undefined
                    || th.cardDetails.cardName.length <= 0
                    || th.cardDetails.cardMonth == null
                    || th.cardDetails.cardMonth == undefined
                    || th.cardDetails.cardMonth.length <= 0
                    || th.cardDetails.cardYear == null
                    || th.cardDetails.cardYear == undefined
                    || th.cardDetails.cardYear.length <= 0
                    || th.cardDetails.cardCvv == null
                    || th.cardDetails.cardCvv == undefined
                    || th.cardDetails.cardCvv.length <= 0
                    || th.cardDetails.minCardYear == null
                    || th.cardDetails.minCardYear == undefined
                    || th.cardDetails.minCardYear.length <= 0
                ) {
                    Swal.fire({
                        title: 'Kart Bilgileri',
                        icon: 'warning',
                        html: 'Lütfen Kart Bilgilerinizi Eksiksiz Girin'
                    });
                    return;
                }

                Swal.fire({
                    title: 'Onay Talebi',
                    icon: 'question',
                    html: 'Ödemeyi onaylamak istediğinize eminmisiniz ? ',
                    showCancelButton: true,
                    confirmButtonText: 'Evet',
                    cancelButtonText: 'Vazgeç',
                }).then((result) => {
                    if (result.isConfirmed) {
                        var url = Global.Urls.VposSystem.api2.DefaultApi.Payment3D;
                        debugger;
                        var paymentMdl = Object.assign({}, th.cardDetails);
                        paymentMdl.cardNumber = paymentMdl.cardNumber.replaceAll(' ', '');
                        paymentMdl.amount = th.PaymentPrice > 0 ? th.PaymentPrice : th.totalPaymentFee;

                        //Companycode ve Customercode
                        var paymentItem = JSON.parse(localStorage.getItem('payment-item'))[0];
                        paymentMdl.CompCode = paymentItem['COMP_CODE'];
                        paymentMdl.CustomerCode = paymentItem['CUSTOMER_CODE'];
                        if (th.bankBinNumber) {
                            paymentMdl.bankCode = th.bankBinNumber.banka_kodu;
                        }


                        var mdl = {
                            saleInfo: paymentMdl,
                        }
                        showLoading();
                        mc.post(url, mdl, function (res) {
                            var form = th.fnk_create_form(res);
                            form.submit();
                            hideLoading();
                        })


                        localStorage.setItem('payment-items', JSON.stringify(newArray));
                        window.dispatchEvent(new Event('historyPaymentEvent'));
                        th.cardDetails = {
                            cardNumber: '',
                            cardYear: '',
                            cardMonth: '',
                            cardName: '',
                            cardCvv: '',
                            minCardYear: new Date().getFullYear(),
                        };
                    }
                });
            },
            fnk_create_form: function (value) {
                var url = Global.Urls.VposSystem.mvc.Default.Redirect3D_Post;
                var form = document.createElement('form');
                var input = document.createElement('input');
                form.setAttribute('action', url);
                form.setAttribute('method', 'POST');
                input.setAttribute('name', 'HTML');
                input.setAttribute('id', 'HTML');
                input.setAttribute('value', value);
                form.appendChild(input);
                document.body.appendChild(form);
                return form;
            }
        },
        mounted: function () {
            var th = this;
            window.addEventListener('paymentEvent', function (e) {
                th.isOpen = true;
                th.totalPaymentFee = JSON.parse(localStorage.getItem('payment-item')).map(function (m) {
                    return m.DEBIT_AMOUNT;
                }).reduce(function (b, a) {
                    return b + a;
                });
            });

        }
    }
